package main

import (
	"encoding/base64"
	"github.com/lxn/walk"
	. "github.com/lxn/walk/declarative"
	"io"
	"io/ioutil"
	"log"
	"os"
	"os/exec"
	"strconv"
	"time"
	"view/src/com.jenkin.view/commonConst"
	"view/src/com.jenkin.view/downloader"
	"view/src/com.jenkin.view/wallpaper"
)

var userNameLabelPoint *walk.Label
var passwordLabelPoint *walk.Label
var passwordEditPoint *walk.TextEdit
var userCodeEditPoint *walk.TextEdit
var processLabelPoint *walk.Label
var loginButtonPoint *walk.PushButton
var registerButtonPoint *walk.PushButton
var nextButtonPoint *walk.PushButton
var viewWallpaperButtonPoint *walk.PushButton
var windowMain *walk.MainWindow

var notifyIcon *walk.NotifyIcon
var imgViewPoint *walk.ImageView
var children []Widget
var compose *walk.Composite
var processText = "壁纸下载进度："

const app_ico = ""

func main() {
	wallpaper.Init()

	file, err := os.OpenFile(commonConst.CurrentPathDir+"wallpaper.log", os.O_APPEND|os.O_CREATE, 666)
	if err != nil {
		log.Fatalln("日志文件创建失败!")
	}
	defer file.Close()
	mw := io.MultiWriter(os.Stdout, file)
	log.SetOutput(mw)
	log.SetFlags(log.Ldate | log.Ltime | log.Lshortfile)
	log.Println("初始化日志成功")

	initUI()

}
func initUI() {

	log.Println("初始化ui界面")
	//托盘图标文件
	ico, _ := base64.StdEncoding.DecodeString(app_ico)
	ioutil.WriteFile(commonConst.CurrentPathDir+"app.ico", ico, 0666)

	userNameLabel := Label{Text: "用户名", AssignTo: &userNameLabelPoint}
	passwordLabel := Label{Text: "密码", AssignTo: &passwordLabelPoint}
	passwordEdit := TextEdit{Name: "密码", AssignTo: &passwordEditPoint, MaxSize: Size{100, 30}}
	userCodeEdit := TextEdit{Name: "用户名", AssignTo: &userCodeEditPoint, MaxSize: Size{100, 30}}
	//图片下载进度
	processLabel := Label{Text: processText + "0.00%", AssignTo: &processLabelPoint, Visible: false, ColumnSpan: 2}
	//登录按钮
	loginButton := PushButton{
		ColumnSpan: 1,
		MaxSize:    Size{100, 30},
		Text:       "登录",
		OnClicked: func() {
			log.Println("登录按钮点击")
			go execLogin(windowMain, userCodeEditPoint, passwordEditPoint)
		},
		AssignTo: &loginButtonPoint,
	}
	// 去注册按钮
	registerButton := PushButton{
		ColumnSpan: 1,
		MaxSize:    Size{100, 30},
		Text:       "没有用户？去注册",
		OnClicked: func() {
			exec.Command("cmd", "/c", "start", "http://tencent.jenkin.tech:8000/").Start()
		},
		AssignTo: &registerButtonPoint,
	}
	// 下一张按钮
	nextButton := PushButton{
		ColumnSpan: 1,
		MaxSize:    Size{100, 30},
		Text:       "下一张",
		OnClicked: func() {
			nextButtonPoint.SetEnabled(false)
			go wallpaper.Next()
		},
		Visible:  false,
		AssignTo: &nextButtonPoint,
	}
	// 进入网站查看壁纸
	viewWallpaperButton := PushButton{
		ColumnSpan: 1,
		MaxSize:    Size{100, 30},
		Text:       "浏览更多壁纸",
		OnClicked: func() {
			exec.Command("cmd", "/c", "start", "http://tencent.jenkin.tech:8000/#/nav/wpManage/category").Start()
		},
		Visible:  false,
		AssignTo: &viewWallpaperButtonPoint,
	}
	// 预览图
	imageView := ImageView{
		ColumnSpan: 2,
		Margin:     0,
		Mode:       ImageViewModeShrink,
		Visible:    false,
		AssignTo:   &imgViewPoint,
	}
	// 主窗口子组件
	children = []Widget{
		userNameLabel,
		userCodeEdit,
		passwordLabel,
		passwordEdit,
		loginButton,
		registerButton,
		nextButton,
		viewWallpaperButton,
		processLabel,
		imageView,
	}

	// 主窗口
	_ = MainWindow{
		AssignTo: &windowMain,
		Children: []Widget{
			Composite{
				AssignTo: &compose,
				Layout:   Grid{Columns: 2},
				Children: children,
			},
		},
		Size:   Size{500, 400},
		Title:  "GoDesk!",
		Layout: HBox{},
	}.Create()
	log.Println("初始化托盘图标")
	go buildNotifyIcon()
	windowMain.Closing().Attach(func(canceled *bool, reason walk.CloseReason) {
		notifyIcon.SetVisible(true)
		//notifyIcon.ShowInfo("通知", "点击图标可再次打开程序")
		*canceled = true
		log.Println(*canceled)
		windowMain.Hide()

	})
	log.Println("初始化ui界面完成")
	windowMain.Run()
}

func buildNotifyIcon() *walk.NotifyIcon {
	mainWindow, _ := walk.NewMainWindow()

	icon, err := walk.Resources.Icon("cache/app.ico")

	if err != nil {
		log.Fatal(err)
	}
	iconInstance, err := walk.NewNotifyIcon(mainWindow)
	notifyIcon = iconInstance
	if err != nil {
		log.Fatal(err)
	}
	defer notifyIcon.Dispose()
	if err := notifyIcon.SetIcon(icon); err != nil {
		log.Fatal(err)
	}
	if err := notifyIcon.SetToolTip("右键可选择退出程序"); err != nil {
		log.Fatal(err)
	}

	exitAction := walk.NewAction()
	if err := exitAction.SetText("退出"); err != nil {
		log.Fatal(err)
	}
	//Exit 实现的功能
	exitAction.Triggered().Attach(func() {
		os.Exit(0)
	})
	//clickAction := walk.NewAction()
	notifyIcon.MouseDown().Attach(func(x, y int, button walk.MouseButton) {
		if walk.LeftButton == button {
			windowMain.Show()

		}
	})

	if err := notifyIcon.ContextMenu().Actions().Add(exitAction); err != nil {
		log.Fatal(err)
	}
	mainWindow.Run()
	return notifyIcon
}

func execLogin(mainWindow *walk.MainWindow, userTE *walk.TextEdit, pwTE *walk.TextEdit) {
	log.Println("登录")
	loginButtonPoint.SetEnabled(false)
	wallpaper.PreConn()
	wallpaper.Login(userTE.Text(), pwTE.Text())
	res := <-wallpaper.LoginCh
	if res {

		go wallpaper.Start()
		go monitorDownloadProcess()
		showPreImage()
	} else {
		loginButtonPoint.SetEnabled(true)
		walk.MsgBox(
			mainWindow,
			"登录失败",
			"请检查用户名或密码是否错误",
			walk.MsgBoxOK)

	}
}

func monitorDownloadProcess() {
	processLabelPoint.SetVisible(true)
	for val := range downloader.PercentCh {
		time.Sleep(time.Millisecond * 5)
		processLabelPoint.SetText(processText + strconv.FormatFloat(val, 'f', 2, 64) + "%")
	}
}

func showPreImage() {

	log.Println("预览图片")
	loginButtonPoint.SetVisible(false)
	userNameLabelPoint.SetVisible(false)
	passwordEditPoint.SetVisible(false)
	userCodeEditPoint.SetVisible(false)
	passwordLabelPoint.SetVisible(false)
	registerButtonPoint.SetVisible(false)
	nextButtonPoint.SetVisible(true)
	viewWallpaperButtonPoint.SetVisible(true)
	imgViewPoint.SetVisible(true)

	for s := range wallpaper.PreImageCh {
		func() {
			defer func() {
				if err := recover(); err != nil {
					//  输出异常信息
					log.Println("预览图片error,切换下一张:", err)
					wallpaper.Next()
				}
			}()
			if len(s) > 0 {
				if imgViewPoint.Image() != nil {
					imgViewPoint.Image().Dispose()
				}
				log.Println("收到预览图片：", s)
				image, _ := walk.NewImageFromFileForDPI(s, 96)
				setImage := imgViewPoint.SetImage(image)
				if setImage != nil {
					log.Println("设置预览失败：", setImage)
				}
				log.Println("设置预览成功")
				nextButtonPoint.SetEnabled(true)
			}

		}()

	}
}
